import React, { FC, CSSProperties } from 'react';

interface Props {
  top: String;
  left: String;
  size: String;
}

const HighlitedText: FC<Props> = ({ top, left, size }) => {
  const style: CSSProperties = {
    top: { top } + '%',
    left: { left } + '%',
    height: { size } + 'px',
    aspectRatio: 1,
    borderRadius: size + 'px',
    backgroundColor: 'red',
  };

  return <div style={style}></div>;
};

export default HighlitedText;
